    <div className="App" 
        style={{ backgroundImage: `url(${wallpaper})`, backgroundSize: 'cover', backgroundRepeat: 'no-repeat', minHeight: '100vh', margin: 0, padding: 0 }}>
      <div className="content">
        <h1>BEATS</h1>
          <Playlist />
      </div>
    </div>
  );
}

export default App;
